import './index.css'

const Disease =()=>{
    return(
        <div className="disease-container">
            <h1 className='Disease-heading'>Diseases</h1>
            <div className='disease-card'>
                <img className='card-image' src='https://i.pinimg.com/736x/93/12/60/931260aa76f5ef8af9a2173b4298ffb1.jpg' alt='disease-image' />
                <p className='disease-name'>White Spot Syndrome (WSS)</p>
                <button className='button'>View</button>
            </div>
        </div>
    )
}

export default Disease;
